/* CREATE DATABASE myphpblog; */
USE myphpblog;

CREATE TABLE `posts` (
  `id` int(11) NOT NULL,
  `title` varchar(255) NOT NULL,
  `body` text NOT NULL,
  `author` varchar(255) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `image` longblob
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


INSERT INTO `posts` (`id`, `title`, `body`, `author`, `created_at`, `image`) VALUES
(65, 'PHP Introduction', 'PHP scripts are executed on the server.\r\n\r\nWhat You Should Already Know\r\nBefore you continue you should have a basic understanding of the following:\r\n\r\nHTML\r\nCSS\r\nJavaScript\r\nIf you want to study these subjects first, find the tutorials on our Home page.\r\n\r\nWhat is PHP?\r\nPHP is an acronym for \"PHP: Hypertext Preprocessor\"\r\nPHP is a widely-used, open source scripting language\r\nPHP scripts are executed on the server\r\nPHP is free to download and use\r\nPHP is an amazing and popular language!\r\n\r\nIt is powerful enough to be at the core of the biggest blogging system on the web (WordPress)!\r\nIt is deep enough to run the largest social network (Facebook)!\r\nIt is also easy enough to be a beginner\'s first server side language!\r\n\r\nWhat is a PHP File?\r\nPHP files can contain text, HTML, CSS, JavaScript, and PHP code\r\nPHP code are executed on the server, and the result is returned to the browser as plain HTML\r\nPHP files have extension \".php\"\r\nWhat Can PHP Do?\r\nPHP can generate dynamic page content\r\nPHP can create, open, read, write, delete, and close files on the server\r\nPHP can collect form data\r\nPHP can send and receive cookies\r\nPHP can add, delete, modify data in your database\r\nPHP can be used to control user-access\r\nPHP can encrypt data\r\nWith PHP you are not limited to output HTML. You can output images, PDF files, and even Flash movies. You can also output any text, such as XHTML and XML.\r\n\r\nWhy PHP?\r\nPHP runs on various platforms (Windows, Linux, Unix, Mac OS X, etc.)\r\nPHP is compatible with almost all servers used today (Apache, IIS, etc.)\r\nPHP supports a wide range of databases\r\nPHP is free. Download it from the official PHP resource: www.php.net\r\nPHP is easy to learn and runs efficiently on the server side', 'redmor', '2018-12-11 03:28:27', );
INSERT INTO `posts` (`id`, `title`, `body`, `author`, `created_at`, `image`) VALUES
(66, 'PHP Installation', 'What Do I Need?\r\nTo start using PHP, you can:\r\n\r\nFind a web host with PHP and MySQL support\r\nInstall a web server on your own PC, and then install PHP and MySQL\r\nUse a Web Host With PHP Support\r\nIf your server has activated support for PHP you do not need to do anything.\r\n\r\nJust create some .php files, place them in your web directory, and the server will automatically parse them for you.\r\n\r\nYou do not need to compile anything or install any extra tools.\r\n\r\nBecause PHP is free, most web hosts offer PHP support.\r\n\r\nSet Up PHP on Your Own PC\r\nHowever, if your server does not support PHP, you must:\r\n\r\ninstall a web server\r\ninstall PHP\r\ninstall a database, such as MySQL\r\nThe official PHP website (PHP.net) has installation instructions for PHP: http://php.net/manual/en/install.php', 'redmor', '2018-12-11 03:29:19', );

